webpackJsonp([0x6f9357c9942b],{416:function(i,t){i.exports={data:{site:{siteMetadata:{rootURL:"https://naoty.github.io"}},markdownRemark:{frontmatter:{title:"ISUCON 8予選のKPT",time:"2018-09-17T11:13:00+0900",description:"ISUCON 8に予選敗退したのでKPTをした"},html:"<p>ISUCON 8に参加して予選敗退した。会社の同僚と「チームプロ開」として参加し、自分はアプリケーションを担当していた。結果的にベストスコアは16000くらいで終わった。悔しい結果になってしまったので、KPTして次回に活かしたい。</p>\n<h1>Keep</h1>\n<ul>\n<li>N+1クエリを直したり<code>SELECT * FROM reservations</code>のような全カラムを取得する箇所を直すなど、基本的な修正は短時間でできた。</li>\n<li>事前に確認しておいたRedisの導入がスムーズにできた。そこまで大きいインパクトはなかったけど。</li>\n<li><code>git tag 1310</code>のようにスコアをタグ付けする運用がけっこうよかった。failが続いた局面でどこまでrollbackすればいいか分かりやすかった。</li>\n</ul>\n<h1>Problem</h1>\n<ul>\n<li>Macに開発環境をセットアップするのに時間がかかってしまった。普段はDocker中心の開発環境で仕事しているので、久々にMySQLをインストールしようとしたらハマってしまった。</li>\n<li>h2oからnginxへの移行や複数台構成への移行で時間がとられてしまった。アプリケーションの修正を開始したのは15:30くらいからになってしまった。</li>\n<li>ロックがボトルネックになっていることに気づかなかった。ベンチマークガチャとか言って思考停止していた。</li>\n</ul>\n<h1>Try</h1>\n<ul>\n<li>事前に開発環境をセットアップしておく。</li>\n<li>慣れない作業でハマったときは思い切ってやらない決断も必要。</li>\n<li>時間がなくてできなかったけど、実装を書き直したりスキーマを変更して根本的に改善できるようにしたい。</li>\n</ul>",fileAbsolutePath:"contents/posts/41.md"}},pathContext:{id:"contents/posts/41.md absPath of file >>> MarkdownRemark"}}}});
